C#上机三 1．请定义一个交通工具(Vehicle)的类，其中有: ⦁ 属性：速度(speed)，体积(size); ⦁ 方法：移动(move())，设置速度(setSpeed(int speed))，设置体积（setSize(int size)）加速speedUp(),减速speedDown(); 在测试类Vehicle中的main()中实例化一个交通工具对象，通过方法给它初始化speed,size的值，并打印出来。另外，调用加速，减速的方法对速度进行改变。 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556using System;using System.Collections.Generic;using System.Linq;using System.Text;using System.Threading.Tasks;/*1．请定义一个交通工具(Vehicle)的类，其中有: ⦁ 属性：速度(speed)，体积(size);⦁ 方法：移动(move())，设置速度(setSpeed(int speed))，设置体积（setSize(int size)）加速speedUp(),减速speedDown();在测试类Vehicle中的main()中实例化一个交通工具对象，通过方法给它初始化speed,size的值，并打印出来。另外，调用加速，减速的方法对速度进行改变。*/namespace Suke.day07&#123; internal class VehicleTest &#123; static void Main(string[] args) &#123; Vehicle vehicle = new Vehicle(4,5); vehicle.printVehicle(); vehicle.move(); vehicle.speedUp(); vehicle.speedDown(); Console.ReadKey(); &#125; &#125; public class Vehicle &#123; public int size; public int speed; public Vehicle() &#123; &#125; public Vehicle(int size, int speed) &#123; this.size = size; this.speed = speed; &#125; public void setSize(int size) &#123; &#125; public int getSize() &#123; return size; &#125; public void setSpeed(int speed) &#123; &#125; public int getSpeed() &#123; return speed; &#125; public void move() //构造方法move &#123; Console.WriteLine(&quot;前方请注意！体积为&#123;0&#125;公斤的大黄蜂正在以速度&#123;1&#125;公里/秒向目标移动！&quot;, size, speed); &#125; public void speedUp() //构造方法speedUp &#123; Console.WriteLine(&quot;加速加速加速+&#123;0&#125;+&#123;1&#125;+.+.+.+..&quot;, ++size, ++size); &#125; public void speedDown() //构造方法speedDown &#123; Console.WriteLine(&quot;减速减速减速-&#123;0&#125;-&#123;1&#125;-.-.-.-..&quot;, --size, --size); &#125; public void printVehicle() //打印输出Vehicle类 &#123; Console.WriteLine(&quot;Szie: &#123;0&#125;
Speed: &#123;1&#125;&quot;, size, speed); &#125; &#125;&#125; 2．试编写一个函数compute(int a,int b,int sum,int sub,int mul,int quo )，其中sum、sub、mul、quo分别是a，b的和、差、积、商。并编写主函数测试上述函数。提示：和、差、积、商分别采用ref和out形参两种方式实现。 1234567891011121314151617181920212223242526272829303132333435363738394041424344using System;using System.Collections.Generic;using System.Linq;using System.Text;using System.Threading.Tasks;/*2．试编写一个函数compute(int a,int b,int sum,int sub,int mul,int quo )， * 其中sum、sub、mul、quo分别是a，b的和、差、积、商。 * 并编写主函数测试上述函数。提示：和、差、积、商分别采用ref和out形参两种方式实现。*/namespace Suke.day07&#123; internal class MathTest &#123; static void Main(string[] args) &#123; int a = 2; int b = 4; int sum = SumValue(2, ref b); int sub = SubValue(2, out b); int mul = MulValue(ref a, 4); int quo = QuoValue(out a, 4); Console.WriteLine(&quot;和=&#123;0&#125;
差=&#123;1&#125;
积=&#123;2&#125;
商=&#123;3&#125;&quot;,sum,sub,mul,quo); Console.ReadKey(); &#125; public static int SumValue(int a, ref int b) //和sum，传参b &#123; return a + b; &#125; public static int SubValue(int a, out int b) //差sub，输出b=2 &#123; b = 2; return a - b; &#125; public static int MulValue(ref int a,int b) //积mul，传参a &#123; return a * b; &#125; public static int QuoValue(out int a,int b) //商quo，输出a=4 &#123; a = 4; return a / b; &#125; &#125;&#125; 3．定义一个接口，它含有两个方法：一个方法用于实现两个数中求最小的数，一个方法用于实现在2个数中求最大的数。定义一个类实现这个接口，再定义派生类中，给出方法Max()、方法Min()的实现； 试在主函数中通过委托MyDelegate的对象md来分别调用上述两个方法Max、Min求一个一维数组的最大值及最小值。 【来源：https://python.iitter.com/other/384020.html，转载请注明】 12345678910111213141516171819202122232425262728293031323334353637383940414243444546using System;using System.Collections.Generic;using System.Linq;using System.Text;using System.Threading.Tasks;/*3．定义一个接口，它含有两个方法：一个方法用于实现两个数中求最小的数， * 一个方法用于实现在2个数中求最大的数。定义一个类实现这个接口， * 再定义派生类中，给出方法Max()、方法Min()的实现； * 试在主函数中通过委托MyDelegate的对象md来分别调用上述两个方法Max、Min求一个一维数组的最大值及最小值。*/namespace Suke.day07&#123; internal class DelegateTest &#123; static void Main(string[] args) &#123; MyClass mc = new MyClass(); MyDelegate md1 = new MyDelegate(mc.Max); MyDelegate md2 = new MyDelegate(mc.Min); Console.WriteLine(&quot;最大值=&#123;0&#125;
最小值=&#123;1&#125;&quot;, md1(2, 4), md2(2, 4)); Console.ReadKey(); &#125; &#125; public delegate int MyDelegate(int a, int b);//声明委托 public class MyClass : MyVirtual //重写接口构造方法 &#123; public int Max(int a, int b) &#123; if (a &gt; b) return a; else return b; &#125; public int Min(int a, int b) &#123; if (a &lt; b) return a; else return b; &#125; &#125; public interface MyVirtual //定义接口 &#123; int Max(int a, int b); int Min(int a, int b); &#125;&#125; 定义一个抽象的&quot;Role&quot;类，有用户名，密码，权限等成员变量 （1）要求尽可能隐藏所有变量，再通过属性对各变量进行读写。再定义一个具有抽象的play()方法， 该方法只输出用户名，不返回任何值，同时至少定义两个构造方法。 （2）从Role类派生出一个&quot;Student&quot;类，该类具有Role类的所有成员（构造方法除外），并扩展number成员变量，同时增加一个静态成员变量“telephone”。 同样要有至少两个构造方法，并定义覆盖play()方法。 （3）在Main()方法中生成Student的对象,并测试这些对象的方法。 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586using System;using System.Collections.Generic;using System.Linq;using System.Text;using System.Threading.Tasks;/*4. 定义一个抽象的&quot;Role&quot;类，有用户名，密码，权限等成员变量（1）要求尽可能隐藏所有变量，再通过属性对各变量进行读写。再定义一个具有抽象的play()方法，该方法只输出用户名，不返回任何值，同时至少定义两个构造方法。（2）从Role类派生出一个&quot;Student&quot;类，该类具有Role类的所有成员（构造方法除外），并扩展number成员变量，同时增加一个静态成员变量“telephone”。同样要有至少两个构造方法，并定义覆盖play()方法。（3）在Main()方法中生成Student的对象,并测试这些对象的方法。*/namespace Suke.day07&#123; internal class RoleTest &#123; static void Main(string[] args) &#123; Student student = new Student(&quot;圣仙&quot;,192001,true,35226); student.printRole(); student.printStudent(); student.play(); student.study(); student.eat(); Console.ReadKey(); &#125; &#125; public class Student : Role //继承父类Role &#123; private int number; public Student()&#123;&#125; public Student(Role role,int number) &#123; Role = role; this.number = number; &#125; public Student(string name, int password, bool power, int number) &#123; Name = name; Password = password; Power = power; this.number = number; &#125; public Role Role &#123; get; set; &#125; public int Number &#123; get; set; &#125; public override void play() //重写构造方法 &#123; Console.WriteLine(&quot;执行play()方法: 学生用户已登录&quot;); &#125; public void study() &#123; Console.WriteLine(&quot;执行study()方法: 好好学习，天天向上&quot;); &#125; public void eat() &#123; Console.WriteLine(&quot;执行eat()方法: 吃饱再学习&quot;); &#125; public void printStudent() //打印输出Student类 &#123; Console.WriteLine(&quot;执行printStudent()方法: Name=&#123;0&#125;,PassWord=&#123;1&#125;,Power=&#123;2&#125;,Number=&#123;3&#125;&quot;, Name,Password,Power,number); &#125; &#125; public abstract class Role //定义抽象类 &#123; private string name; //用户名 private int password; //密码 private bool power; //权限 public Role() &#123; &#125; public Role(string name, int password, bool power) &#123; this.name = name; this.password = password; this.power = power; &#125; public string Name &#123; get; set; &#125; public int Password &#123; get; set; &#125; public bool Power &#123; get; set; &#125; public abstract void play(); //抽象构造方法 public void printRole() //打印输出Role类 &#123; Console.WriteLine(&quot;执行printRole()方法: Name=&#123;0&#125;,PassWord=&#123;1&#125;,Power=&#123;2&#125;&quot;, name, password, power); &#125; &#125;&#125; 5．创建C#控制台应用程序，建立一个点类CzPoint，为其定义两个double类型的私有字段成员x和y，分别表示点的横坐标和纵坐标；对CzPoint类进行相等和不等操作符重载。注：两个坐标点相等，则指它们的横坐标和纵坐标都相等。 在Main()方法中对两个坐标点是否相同进行测试。 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162using System;using System.Collections.Generic;using System.Linq;using System.Text;using System.Threading.Tasks;/*5．创建C#控制台应用程序，建立一个点类CzPoint，为其定义两个double类型的私有字段成员x和y， * 分别表示点的横坐标和纵坐标；对CzPoint类进行相等和不等操作符重载。 * 注：两个坐标点相等，则指它们的横坐标和纵坐标都相等。 * 在Main()方法中对两个坐标点是否相同进行测试。*/namespace Suke.day07&#123; internal class CzPointTest &#123; static void Main(string[] args) &#123; CzPoint p1 = new CzPoint(3, 4); CzPoint p2 = new CzPoint(5, 4); string equal = null; equal = (p1 == p2 ? &quot;相等&quot; : &quot;不相等&quot;); System.Console.WriteLine(&quot;移动前p1和p2&quot; + equal); p1.Move(2, 0); equal = (p1 == p2 ? &quot;相等&quot; : &quot;不相等&quot;); System.Console.WriteLine(&quot;移动后p1和p2&quot; + equal); Console.ReadKey(); &#125; &#125; class CzPoint &#123; private double x; //横坐标 private double y; //纵坐标 public CzPoint(double x, double y) &#123; this.x = x; this.y = y; &#125; public double X &#123; get;set; &#125; public double Y &#123; get; set; &#125; public void Move(double dx, double dy) &#123; x += dx; y += dy; &#125; public static bool operator ==(CzPoint p1, CzPoint p2) &#123; if (p1.x == p2.x &amp;&amp; p1.y == p2.y) &#123; return true; &#125; return false; &#125; public static bool operator !=(CzPoint p1, CzPoint p2) &#123; if (p1.x == p2.x &amp;&amp; p1.y == p2.y) &#123; return false; &#125; return true; &#125; &#125;&#125;
